import Layout from "../components/Layout";
import phones from "../database/index";

const Index = () => {
  const renderPhones = () => {
    const phoneList = phones.map(phone => {
      return (
        <li>
          <div>
            <a>{phone.name}</a>
          </div>
          <ul>
            <li>
              {() => {
                for (let [key, value] of Object.entries(phone)) {
                  return <p>{`${key} ${value}`}</p>;
                }
              }}
            </li>
          </ul>
        </li>
      );
    });
    return phoneList;
  };

  return (
    <Layout>
      <div className="body">
        <ul>{renderPhones()}</ul>
      </div>
    </Layout>
  );
};

export default Index;
